Advanced Voice and Data Solutions Our primary advanced voice and data solution is marketed under our CallMultiplier brand name. CallMultiplier is a comprehensive cloud-based solution to consumers and businesses for mass notification services using text messages and automated telephone calls. CallMultiplier streamlines and automates delivery of time sensitive voice and text messages to groups. Our customers include sports teams, businesses, religious groups, schools, staffing companies, government entities, property management groups, non-profit companies, clubs and civic groups throughout the United States and Canada.
